import styles from './catalogOfStructures.module.css'
import React from 'react'
import {
  IStructure,
  structuresFounded,
  structuresInDev,
  structuresToDev,
  TStructureType
} from '@/components/catalogOfStructures/structures'
import Image from 'next/image'
import Link from 'next/link'
import Controls from '@/components/catalogOfStructures/controls/controls'

interface ICatalogOfStructures {
  type: TStructureType
}

export default function CatalogOfStructures ({
  type
}: ICatalogOfStructures) {
  let structures: IStructure[]
  let title: string

  switch (type) {
    case 'founded':
      structures = structuresFounded
      title = 'Каталог объектов'
      break
    case 'inDev':
      structures = structuresInDev
      title = 'уже в проработке'
      break
    case 'toDev':
      structures = structuresToDev
      title = 'доступно для проработки'
      break
  }

  return (
    <div className={styles.catalogOfStructures}>
      <div className={styles.divider}>
        <span className={styles.line}></span>
        <span className={styles.text}>{title}</span>
        <span className={styles.line}></span>
      </div>
      {
        type === 'founded' ? (
          <>
            <Controls/>
            <p className={styles.subtext}>
              найдено 3 объекта
            </p>
          </>
        ) : null
      }
      <div className={styles.structures}>
        {
          structures.map(structure => (
            <div key={structure.name} className={styles.structure}>
              <Image
                src={structure.src}
                alt={structure.name}
                width={235}
                height={174}
              />
              <h2>
                {structure.name}
              </h2>
              <ul>
                <li>
                  <svg width='22' height='22' viewBox='0 0 22 22' fill='none'
                       xmlns='http://www.w3.org/2000/svg'
                       xlinkHref='http://www.w3.org/1999/xlink'>
                    <rect width='22' height='22'
                          fill='url(#pattern0_536_2409)'/>
                    <defs>
                      <pattern id='pattern0_536_2409'
                               patternContentUnits='objectBoundingBox' width='1'
                               height='1'>
                        <use xlinkHref='#image0_536_2409'
                             transform='scale(0.00195312)'/>
                      </pattern>
                      <image id='image0_536_2409' width='512' height='512'
                             preserveAspectRatio='none'
                             xlinkHref='data:image/png;base64,'/>
                    </defs>
                  </svg>
                  <span>
                    {structure.date}
                  </span>
                </li>
                <li>
                  <svg width='22' height='22' viewBox='0 0 22 22' fill='none'
                       xmlns='http://www.w3.org/2000/svg'
                       xmlnsXlink='http://www.w3.org/1999/xlink'>
                    <rect width='22' height='22'
                          fill='url(#pattern0_536_2402)'/>
                    <defs>
                      <pattern id='pattern0_536_2402'
                               patternContentUnits='objectBoundingBox' width='1'
                               height='1'>
                        <use xlinkHref='#image0_536_2402'
                             transform='scale(0.00195312)'/>
                      </pattern>
                      <image id='image0_536_2402' width='512' height='512'
                             preserveAspectRatio='none'
                             xlinkHref='data:image/png;base64,'/>
                    </defs>
                  </svg>

                  <span>
                    {structure.location}
                  </span>
                </li>
                <li>
                  <svg width='24' height='24' viewBox='0 0 24 24' fill='none'
                       xmlns='http://www.w3.org/2000/svg'
                       xmlnsXlink='http://www.w3.org/1999/xlink'>
                    <rect width='24' height='24'
                          fill='url(#pattern0_536_2403)'/>
                    <defs>
                      <pattern id='pattern0_536_2403'
                               patternContentUnits='objectBoundingBox' width='1'
                               height='1'>
                        <use xlinkHref='#image0_536_2403'
                             transform='scale(0.00195312)'/>
                      </pattern>
                      <image id='image0_536_2403' width='512' height='512'
                             preserveAspectRatio='none'
                             xlinkHref='data:image/png;base64,'/>
                    </defs>
                  </svg>

                  <span>
                    {structure.historicalValue}
                  </span>
                </li>
              </ul>

              {type === 'toDev' ? <button>Забронировать</button> : <Link
                href={'/catalog/kostel-sv-antoniya-oglavlenie'}
              >
                Подробнее...
              </Link>}
            </div>
          ))
        }
      </div>
    </div>
  )
}